import React from "react";
const Restaurent = (props) => {
const {restaurent}  =props;
    return (
        <div className="card-columns ">
            {
                restaurent.map(rest => (
                <ul>
                    <br></br>
                    <div class="card special border-dark mb-1 ">
                      
                    <div class="card-header text-light cardhead">
                      <h4 ><span class="material-icons">
                            location_on
                            </span> {rest.location}</h4>
                    </div>
                    <div class="card-body .cardbg text-center">
                      <h1 class="card-title name">{rest.name}</h1>
                      <p class="card-text">
                      <h5 class="txt">Locality</h5> {rest.area}<br/>
                      <h5>Food Types Available</h5> {rest.foodtype}<br/>
                      <h5>Average Cost For Two People</h5> {rest.cost}<br/>
                      <h5>Customers Feedback</h5> {rest.feed}<br/>
                      <h5>No of Customers voted</h5> {rest.votes}<br/>                
                      
                      
                      </p>
                       <br></br>
                      <a href="#"class="btn btn-primary">Book Now</a>
                    </div>
                  </div>
                  <br></br><br></br>
</ul>
                ))
                
            }

        </div>
      
      
    );
};
export default Restaurent;
